#include<stdio.h>
#include<math.h>

#define MOD 1000000007

typedef long long int LLI;

int Agli_Sankhya(){
	int num = 0;
    char c = getchar();
    while(!(c>='0' & c<='9'))
        c=getchar();
    while(c>='0' && c<='9'){
        num = (num<<1)+(num<<3)+c-'0';
        c=getchar();
    }
	return num;
}

int adhiktam( int a, int b){
	if(a > b)
		return a;
	else
		return b;
}

int nyoontam(int a, int b){
	if(a < b)
		return a;
	else
		return b;
}

inline int
addMod( int a, int b){
	LLI v=a;
	v+=b;
	if(v>=MOD) v-=MOD;
	return (int)v;
}

inline int
mulMod( int a, int b){
	LLI v=a;
	v*=b;
	if(v>MOD) v = v%MOD;
	return (int)v;
}

inline int
subMod( int a, int b){
	int v = a-b;
	if(v<0)	v+=MOD;
	return v;
}

// MAIN PART STARTS HERE..

double
nthRoot(long long a, int n){
    if(n==2) return sqrt(a);
    if(n==3) return cbrt(a);
    return (double) pow(a, (double) 1.0 / (1.0*n));
}

int
safe(long long n, long long b){
    long long a = 1;
    if(b<=1)
        return 0;
    while(a*b<=n) a = a*b;
    if(a>(n-a)) return 1;
    return 0;
}

int
lowerBound(int l, int u, long long n){
    while(l<=u){
        int m = (l+u)/2;
        int c1 = safe(n, m), c2 = safe(n, m-1);
        if(c1==1 && (c2==0))   return m;
        else if(c1 && c2)    u = m-1;
        else            l = m+1;
    }
    return -1;
}

long long PossibleValues(long long n){
    long long ans = ceil(1.0 * (1.0 * n)/(2.0));
    int x, i;
    //int prev;
    int chk[21] = {0};
    for(x = 2; x<=41; x++){
        double ub = nthRoot(n, x);
        if(ub <= 1)
            break;
        if(ub<=20){
            int id = ub;
            if(chk[id] ) continue;
            chk[id] = 1;
        }
        double lb = nthRoot(n, x+1);

        if(safe(n, ub)){
            int lowBnd = lowerBound(ceil(lb), ub, n);
            lowBnd = lowBnd==-1 ? ub : lowBnd;
            //printf("lb ub: %d %d %d\n", lowBnd, (int)ub, x);
            ans += (long long)ub - lowBnd + 1;
           // prev = lowBnd;
        }
    }
    return ans;
}

long long posValuesFinal(long long n){
    long long ans = 1 + ceil(1.0 * (1.0*n)/(2.0));
    int i;
    double lb = cbrt(n);
    double ub = sqrt(n);
    if(safe(n, ub)){
        int lowBnd = lowerBound(ceil(lb), ub, n);
        lowBnd=lowBnd == 2? lowBnd+1 : lowBnd;
        lowBnd=lowBnd==-1 ? ub : lowBnd;
        ans = ans + (long long)ub-lowBnd+1;
    }
    ub = lb;    lb = nthRoot(n, 4);
    if(safe(n, ub)){
        int lowBnd = lowerBound(ceil(lb), ub, n);
        lowBnd=lowBnd == 2? lowBnd+1 : lowBnd;
        lowBnd=lowBnd==-1 ? ub : lowBnd;
        ans = ans + (long long)ub-lowBnd+1;
    }
    for(i=3; i<=floor(lb); i++) ans += safe(n, i);
    return ans;
}
int solveOther(long long n){
    int i, j = cbrt(n)+1, ans = 0;
    for(i=sqrt(n); i>cbrt(n) && i>2; i--){
        if(safe(n, i)) ans++;
        else{ j = i; break;}
    }
    for(i=3; i<j; i++) ans+=safe(n, i);
    return 1 + ans + ceil(1.0 * (1.0 * n)/(2.0));
}
